import React, { useEffect } from 'react';
import Header from './Header';
import { useSelector } from 'react-redux';
import './index.css'

function Lessons(props) {

    const {sciences} = useSelector(state=>state.userReducer);

    useEffect(()=>{
        console.log(sciences);
    }, [])

    return (
        <div>
            <Header/>
            <div className='body'>
                <div className="wrapper">
                {
                    sciences.map(science=> <div className='card col-3 m-2'>
                        <div className="card-header">
                            <strong className='text-center'>{science.name}</strong>
                        </div>
                        <div className="card-body">
                            <img src={"http://localhost:8080/file/"+science.photo} alt="" />
                        </div>
                    </div> )
                }
                </div>
            </div>
        </div>
    );
}

export default Lessons;
